import React from "react";
import "./StockItem.css";
import { Table, Button } from "antd";
const stockItem = (props) => {
  const dataSource = [
    {
      key: props.stockId,
      value: props.value,
    },
    {
      key: props.stockId,
      value: props.value,
    },
  ];

  const columns = [
    {
      title: "value",
      dataIndex: "value",
      key: "value",
    },
  ];

  return (
    <div>
      <Table dataSource={dataSource} columns={columns} />;
     
    </div>
  );
};

export default stockItem;
